import React from 'react'
import Profile from '../profile/profile';
import Jobs from "../jobs/jobs";
import {Grid} from "@mui/material";
import Skills from "../skills/skills";
import Language from "../language/language";
import Portfolio from "../Portfolio/Portfolio";
import {ResumeJobsData , ResumeAbilitiesData} from "../../ResumeData/ResumeData";
import {RandomGradiant} from "../skills/skills.style";
function ReturnJobs() {
    const Data = ResumeJobsData;
    let JobsJsxArray = [];
    Object.keys(Data).forEach((val, i) => {
        // console.log(Data[val]['JobTitle'])
        JobsJsxArray.push(<Jobs
            key={i}
            JobTitle={Data[val]['JobTitle']}
            JobDuration={Data[val]['JobDuration']}
            JobDepartment={Data[val]['JobDepartment']}
            JobDescription={Data[val]['JobDescription']}
            type={'job'}
        />)
    });
    return JobsJsxArray;
}
function ReturnAbilities() {
    const Data = ResumeAbilitiesData;
    let SkillsJsxArray = [];
    Object.keys(Data).forEach((val, i) => {
        SkillsJsxArray.push(<Skills
            key={i}
            SkillName={Data[val]['skillName']}
            AbilityRate={Data[val]['AbilityRate']}
            gradiant={{backgroundImage:RandomGradiant()}}
        />)
    });
    return SkillsJsxArray;
}
function Layout() {
    // ReturnJobs()
    return (
        <div>
            <Profile/>
            <br/>
            <h2 style={{textAlign: "center", width: "100%", color: "white"}}>
                RESUME
            </h2>
            <Grid container spacing={5} style={{padding: '40px 100px', color: 'white', justifyContent: 'center'}}>


                <Grid item xs={5}>
                    {ReturnJobs()}

                </Grid>
                <Grid item xs={5}>
                    {ReturnAbilities()}
                </Grid>
            </Grid>
            <Grid container spacing={5} style={{padding: '40px 100px', color: 'white', justifyContent: 'center'}}>


                <Grid item xs={5}>
                    <Jobs
                        JobTitle={'Graphic Rivers'}
                        JobDuration={'2013 - 2017'}
                        JobDepartment={'Director Of Department'}
                        JobDescription={"Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit \n" +
                        "id est laborum. Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do iusmod \n" +
                        "incididunt ut labore et dolore magna aliqua."}
                        type={'project'}
                    />

                </Grid>
                <Grid item xs={5}>
                    <h3 style={{textAlign: 'center'}}>
                        Language Skills
                    </h3>
                    <br/>
                    <br/>
                    <br/>
                    <Language
                        name={'English'}
                        Speaking={4}
                        Listening={5}
                        Writing={3}
                        Reading={4}
                    />
                </Grid>
            </Grid>
            <br/>
            <br/>
            <br/>
            <Grid container style={{padding: '40px 100px', color: 'white', justifyContent: 'center'}}>
                <h3 style={{paddingBottom: '40px'}}>Portfolio </h3>

                <Portfolio/>
            </Grid>
        </div>
    )
}

export default Layout;
